//header-navigation bar

const profile="PROFILE";
const home="HOME";
const contact="CONTACT";
const about="ABOUT"

export const navigationContent={profile,home,contact,about};



//FeaturedItems-container

const heading="FEATURED ITEMS";
export const featuredContent={heading};


////sort
const sortHeading="SortBy"
export const sortSpace={sortHeading};


//filter
const filterHeading="Filter"
export const filterSpace={filterHeading};


//productDetails

const appleWatchName="Apple Watch Ultra (GPS + Cellular)"
const appleBrand="Apple"
const appleWatchRating=5
const appleWatchPrice=100000

export const productDetails={appleWatchName,appleBrand,appleWatchPrice,appleWatchRating}
